import { Link } from "react-router-dom";

const Landingpage = () => {
    return (  
       <div className="landingpage">
        <Link to="/merchantlogin"><img src="merchant.png" alt="" /></Link>
        <Link to="/userlogin"><img src="./" alt="" /></Link>
       </div>
    );
}
 
export default Landingpage;
